import React from 'react';
import ReactDOM  from 'react';
import reactDom from 'react-dom';
let name = "arun";
reactDom.render(<><h1>hello i am {name} solanki</h1>
        <p>list of 5 items</p>
        <ul>
          <li>maa tujhe salam</li>
          <li>bajrangi bhaijaan</li>
          <li>bahubali</li>
          <li>suryawanshi</li>
          <li>thakur saheb</li>
        </ul>
</> , document.getElementById("root"));
